import React from 'react';
import './styles/BurgerMenu/BurgerMenu.css'
import { Link } from 'react-router-dom';
import { useSelector } from 'react-redux';
import { selectIsAuth } from './globalSlices/authSlice';

const BurgerMenu = () => {
    const isAuth: boolean = useSelector(selectIsAuth)
    return (
        <div className='BurgerMenu'>
            <div className="BurgerMenu__wrapper">
                <div className="BurgerMenu__head">
                    <div className="accountLink">
                        <Link className="Personal-nav_burger" to={ !isAuth ? '/registration' : '/account'}>
                            <h5>Личный кабинет</h5>
                            <div className="Personal-nav_burger__icon"></div>
                        </Link>
                    </div>
                </div>
                <div className="BurgerMenu__body"></div>
                <div className="BurgerMenu__foot"></div>
            </div>
        </div>
    );
};

export default BurgerMenu;
